import { useParams } from "react-router-dom";
import App from "./App";

function DogDetails() {
  const params = useParams();

  const dogArr = App.defaultProps.dogs;

  function dogRender() {
    dogArr.map((dog) => {
      if (params.name.toUpperCase() === dog.name.toUpperCase()) {
        return (
          <>
            <h1>{dog.name}</h1>
          </>
        );
      }
    });
  }
  return (
    <div>
      <p>{dogRender()}</p>
    </div>
  );
}

export default DogDetails;
